import React from 'react'
import Login from  "./Login"
import { BrowserRouter as Router, Route} from "react-router-dom";
import {  useState } from 'react';
import axios from 'axios'
import Access from "./access"
import BeforeSignIn from "./beforeSignIn"
import Contact from "./pages/ContactPage"
import Navbar from "./Nav/Navbar"


const BeforeLogin = ()=>{
    
  const [Session,setSession] = useState({
    isLoggedin : false ,
    currentUser : null,
    errorMessage : null
  });

  const TokenLocal = localStorage.getItem("token")

  function  Check(){
    if(TokenLocal==null)
    {
      console.log("null")
    }
    else{
      axios
      .post(`http://localhost:1000/api/check?token=${TokenLocal}`)
      .then((res)=>{
         if(res.data==true)
         {
           setSession ({
             isLoggedin : true
           })
         }
         else{
          setSession ({
            isLoggedin : false
          })
         }
      })
    }

  }

  React.useEffect(()=>{
    Check();
  }, []);

  
  return (
    <div>
       
       {
        Session.isLoggedin ? 
        (
          <Access />
        )  
        : 
        (
          <div>
            <Router>
              <Route exact path="/" component={() =>  <Login setSession={setSession}/>} />
              <Route path="/signIn" component={() =>  <BeforeSignIn />}/>
              <Route path="/contact" component={() =>  {<Navbar/>,<Contact />}}/>
            </Router>
          </div>
          
        )
      }
    </div>
   
  );  

}
export default BeforeLogin;
